import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Observable, throwError } from 'rxjs';
import { catchError, retry } from 'rxjs/operators';

@Injectable({
  providedIn: 'root'
})
export class DataService {
  url = 'http://localhost'
  port = '4001'
  configUrl = '/projects';
  patternEndPoint ='/:pattern=';
  constructor(private http: HttpClient) { }

  getDataMatching(pattern:String)
  {
    const fullUrl = this.url+this.port+this.configUrl +this.patternEndPoint+pattern;

    return this.http.get<{id: number; name: string; image: { link: string; }; groups: { id: number; name: string; url: string; }[]; url: string; }[]>(fullUrl);
  }

  getData()
  {
    const fullUrl = this.url+this.port+this.configUrl;
    console.log('Requesting ' + fullUrl)
    console.log(this.http.get(fullUrl));

    return this.http.get<any>(this.url+this.port+this.configUrl);
  }

}
